UUlScprmos8MArLnKorbNroR/wnlbn6i7kqW8ALm7xpuGnKmJlZNkaZyRo5urvwCZiJpUAEpwRmusf49jJFaioKwAhGd5XiJUcUptx6fCGgAyZk9nAGNCVFMCUoVjfM6qu55cS6JrbwCXe2OTXFd6Rl6QVlvWfFXYl2//p07x4ScIwgAAAABJRU5ErkJggg==",blurWidth:6,blurHeight:8},description:(0,a.jsxs)(a.Fragment,{children:["As a ",(0,a.jsx)("strong",{children:"software engineer"}),", I am passionate about creating elegant, maintainable code that solves complex problems and delivers value to users. With proficiency in a variety of technologies, including"," ",(0,a.jsx)("strong",{children:"ReactJS,AngularJS, NextJS, NodeJS, TypeScript, and Redux"}),", I have experience developing scalable, performant, and user-friendly web solutions."]}),aboutItems:[{label:"Location",text:"Lahore, Pakistan",Icon:h.Z},{label:"Age",text:"24",Icon:x.Z},{label:"Nationality",text:"Pakistani",Icon:u.Z},{label:"Interests",text:"Learning new technologies",Icon:g.Z},{label:"Study",text:"University of Punjab (PUCIT)",Icon:p.Z},{label:"Employment",text:"Careem (Uber Inc.)",Icon:f.Z}]},B=[{title:"Galileo",description:"Developing state-of-the-art dynamic configuration and experimentation platform named Galileo. Galileo enables the organization to run A/B testing, multivariate testing, feature rollouts as well as providing reliable solution for dynamic configuration. In just a few months after a first release, we were able to completely deprecate most of external vendors and enabled client-side experimentation across the company with unprecedented reliability and simplicity.",url:"https://blog.careem.com/en/galileo-analysis-and-reporting-of-experiments/",image:{src:"/_next/static/media/galileo.19b4e06a.jpg",height:1300,width:1999,blurDataURL:"data:image/jpeg;base64,",blurWidth:8,blurHeight:5}},{title:"Donation CMS",description:"Build a Donation CMS for donation mini app to change the donations text in the app dynamically instead of manual changes in the app by pushing build of app again.",url:"https://www.careem.com/en-AE/donations/",image:{src:"/_next/static/media/donations.c2262218.jpg",height:1300,width:1999,blurDataURL:"data:image/jpeg;base64,",blurWidth:8,blurHeight:5}},{title:"Osiris",description:"The inbuilt tool employed at Careem serves as a versatile solution for managing data configurations. Integrated with Slack and Jira, it automates the generation of tickets and facilitates Slack notifications. The tool's functionalities extend to the creation of Kafka topics, database connections, events, and SQL jobs crucial to Careem's operations. The individual has actively contributed to the development of numerous features within this tool, making it an instrumental asset. Its capabilities streamline the automation of repetitive tasks, thereby enhancing overall efficiency in various aspects of Careem's workflow.",url:"",image:{src:"/_next/static/media/osiris.acf345e0.jpg",height:1300,width:1999,blurDataURL:"data:image/jpeg;base64,",blurWidth:8,blurHeight:5}},{title:"Github Migration",description:"I played a key role in a significant GitHub migration project within our team, where our primary responsibility was to seamlessly transfer approximately 2700 organizational repositories from Bitbucket or GitLab to GitHub. Subsequently, we undertook the task of deprecating Jenkins for service deployment, opting for the implementation of GitHub Actions workflows across nearly 760 repositories. My specific contribution involved enhancing around 80 repositories by integrating GitHub Actions and, in some cases, implementing Dockerization for services that had not been dockerized previously. This initiative aimed to streamline our development and deployment processes, leveraging GitHub's robust features for a more efficient and cohesive workflow.",url:"https://blog.careem.com/?s=donations",image:{src:"/_next/static/media/github-actions.2bb22796.jpg",height:1300,width:1999,blurDataURL:"data:image/jpeg;base64,",blurWidth:8,blurHeight:5}},{title:"Yoda",description:'Building a highly scalable platform for managing end-to-end machine learning lifecycle which is called Yoda. Yoda provides users with the tools necessary to develop, deploy, and improve machine learning models, automate data workflows, accelerate data processing, and optimize related functionality. One of the key feature is called "one click deployment" which is pretty self-descriptive :)',url:"https://medium.com/careem-tech/yoda-scaling-machine-learning-careem-d4bc8b1be195",image:{src:"/_next/static/media/yoda.2f67be4e.jpg",height:1300,width:1999,blurDataURL:"data:image/jpeg;base64,",blurWidth:8,blurHeight:5}},{title:"Customer Web App",description:"\n    The customer web application stands as a public web portal, providing a user-friendly interface for individuals seeking to initiate current bookings or plan future reservations without the need for an account. This platform caters to the convenience of guests, allowing them to effortlessly create bookings in real-time and schedule future reservations through the intuitive web portal. By eliminating the requirement for user accounts, the portal ensures a seamless and accessible experience for customers, enhancing their ability to engage with the booking process effortlessly. This customer-centric approach not only simplifies immediate bookings but also encourages individuals to plan and schedule their future reservations with ease, contributing to a streamlined and user-friendly booking experience.",url:"https://app.careem.com",image:{src:"/_next/static/media/web-app.bbd552d2.jpg",height:1300,width:1999,blurDataURL:"data:image/jpeg;base64,",blurWidth:8,blurHeight:5}}],S=[{date:"Sep 2017 - Jul 2021",location:"University of Punjab (PUCIT)",title:"BS Software Engineering",content:(0,a.jsxs)("p",{children:[(0,a.jsx)("strong",{style:{color:"#f97316 !important"},children:"Skills:"})," React.js \xb7 Next.js \xb7 Node.js \xb7 TypeScript \xb7 Redux.js \xb7 Redux Thunk \xb7 Gitlab \xb7 Git \xb7 Ant Design \xb7 GitHub"," "]})}],F=[{date:"July 2022 - Present",location:"Lahore, Punjab Pakistan",title:"Software Engineer at Careem",content:(0,a.jsxs)("p",{children:[(0,a.jsx)("strong",{style:{color:"#f97316 !important"},children:"Skills:"})," jQuery \xb7 Tailwind CSS \xb7 Web Engineering \xb7 Amazon Web Services (AWS) \xb7 docker \xb7 Software Deployment \xb7 Agile Methodologies \xb7 Kubernetes \xb7 JavaServer Pages (JSP) \xb7 AngularJS \xb7 Gitlab \xb7 Ant Design \xb7 Jenkins \xb7 TypeScript \xb7 React.js \xb7 GitHub \xb7 Redux.js \xb7 Cascading Style Sheets (CSS) \xb7 Bootstrap \xb7 JavaScript \xb7 Redux Thunk \xb7 Go (Programming Language)"]})},{date:"August 2021 - June 2022",location:"Lahore, Punjab Pakistan",title:"Software Engineer at Munch:ON",content:(0,a.jsxs)("p",{children:["Munch:ON was a product-based business that offered meal services in KSA and the UAE. I worked on this product's web application to maintain it and add a lot of new features including favourite meals, adding items to the cart and placing order from cart, in-app tutorials and many others.",(0,a.jsxs)("span",{style:{display:"block",marginTop:"10px"},children:[(0,a.jsx)("strong",{style:{color:"#f97316 !important"},children:"Skills:"})," jQuery \xb7 Tailwind CSS \xb7 TypeScript \xb7 React.js \xb7 GitHub \xb7 Redux.js \xb7 Node.js \xb7 Next.js \xb7 Cascading Style Sheets (CSS) \xb7 Bootstrap \xb7 JavaScript \xb7 Redux Thunk"," "]})]})}],D={imageSrc:"",testimonials:[{href:"https://www.linkedin.com/in/selcukkizilkaya/",name:"Selcuk Kizilkaya",text:"Fazal demonstrates a strong focus on achieving outcomes and skillfully navigating through numerous challenges. Despite encountering several obstacles, he adeptly resolved each issue by engaging in collaborative discussions with team members, ensuring he could progress and successfully reach the intended goals.",image:"https://cloudflare-ipfs.com/ipfs/Qmd3W5DuhgHirLHGVixi6V76LhCkZUz6pnFt5AJBiyvHye/avatar/14.jpg"},{href:"https://www.linkedin.com/in/yasar1/",name:"Yasar Rahman",text:"Fazal demonstrated a commendable ability to work independently, delivering a high-quality final product with meticulous attention to detail.",image:"https://cloudflare-ipfs.com/ipfs/Qmd3W5DuhgHirLHGVixi6V76LhCkZUz6pnFt5AJBiyvHye/avatar/169.jpg"},{href:"https://www.linkedin.com/in/vimbaimidzi/",name:"Vimbai Beverly Midzi",text:"Fazal's work was instrumental in making sure I had the foundations for a donations CMS. Before this, there was an overdependency on engineering support that was very difficult to secure. He listened to my needs and made edits where necessary to make it more usable to me.",image:"https://cloudflare-ipfs.com/ipfs/Qmd3W5DuhgHirLHGVixi6V76LhCkZUz6pnFt5AJBiyvHye/avatar/69.jpg"},{href:"https://www.linkedin.com/in/azan-ibrar-9b03a3202/",name:"Azan Ibrar",text:"You're an outstanding engineer, and an even more remarkable friend. Your constant support and willingness to help other falcons make a significant impact. Thanks for all the fantastic contributions you bring to the table!",image:"https://cloudflare-ipfs.com/ipfs/Qmd3W5DuhgHirLHGVixi6V76LhCkZUz6pnFt5AJBiyvHye/avatar/14.jpg"},{href:"https://www.linkedin.com/in/zaid-iqbal-702b55150/",name:"Zaid Iqbal",text:"Thanks for being a supportive colleague.",image:"https://cloudflare-ipfs.com/ipfs/Qmd3W5DuhgHirLHGVixi6V76LhCkZUz6pnFt5AJBiyvHye/avatar/14.jpg"},{href:"https://www.linkedin.com/in/sumran-waheed/",name:"Samran Waheed",text:"I want to highlight the outstanding collaboration with Fazal on our recent project. As the Back-End Developer, I worked closely with Fazal, who handled the Front-End tasks.\n\n      Fazal's quick and efficient Front-End work greatly contributed to our project's success. His clear communication and proactive approach ensured seamless collaboration. Despite facing challenges on the Back-End, Fazal consistently provided valuable support, pushing the project forward.\n      \n      I commend Fazal for his dedication, proficiency, and positive attitude. Working with him was a pleasure, and I look forward to future collaborations.",image:"h